import React, { useEffect, useState } from 'react'

function App() {

  const [backendData, setBackendData] = useState([{}])

  useEffect (() => {
    fetch("/user/all").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, [])

  console.log(backendData)
  return (
    <div className="App">
      {backendData.map((data) => 
        <div>
          {data.name}
        </div>
      )}
    </div>
  );
}

export default App;
